export default function Hoo() {

  let [Info,setInfo]=useState({
    Name:"Manpreet Kaur",
    College:'amity University Madhya Pradesh ',
    Age:'20',
    Hobby:'Badminton'
  })
  return (
    <div>

      <p> Name: {Info.Name}</p>



      <button onClick={()=>{
       if(Info.Name==='Manpreet Kaur') 
       {setInfo({
          Name:'Aaayushmaan verma',
        College:'ITM university',
          Age:'26',
          Hobby:'Cricket'
        })}
        else{
          setInfo({
            Name:'Manpreet Kaur',
            College:'amity University Madhya Pradesh ',
            Age:'20',
            Hobby:'Badminton'
          })
        }

      }}>Click Me</button>
    </div>
  );
}
